var list = (type) => {
  return {
    serialize(value, context) {
      if (!Array.isArray(value)) {
        return;
      } else {
        return value.map(v => type.serialize(v, context));
      }
    },
    deserialize(json, context) {
      if (!Array.isArray(json)) {
        return;
      } else {
        return json.map(j => type.deserialize(j, context));
      }
    }
  }
}

var object = (schema) => {
  return {
    serialize(value, context) {
      if (!value) { return; }
      let json = {};
      Object.entries(schema).forEach(([key, subSchema]) => {
        if (value.hasOwnProperty(key)) {
          json[key] = getType(subSchema).serialize(value[key], context);
        }
      });
      return json;
    },
    deserialize(json, context) {
      if (!json) { return; }
      const m = {};
      Object.entries(schema).forEach(([key, subSchema]) => {
        if (json.hasOwnProperty(key)) {
          m[key] = getType(subSchema).deserialize(json[key], context);
        }
      });
      return m;
    }
  }
}

var primitive = () => {
  return {
    serialize(value, context) {
      return value;
    },
    deserialize(json, context) {
      return json;
    }
  }
}

var raw = () => {
  return {
    serialize(value, context) {
      //toJS
      return value;
    },
    deserialize(json, context) {
      return json;
    }
  }
}

// @create-index

class Serializable {
  constructor(schema, factory) {
    this.schema = schema;
    if (factory) {
      this.factory = factory;
    }
  }

  define(schema) {
    this.schema = schema;
  }

  factory(context) {
    if (this._factory) {return this._factory(context)}
    return {};
  }

  serialize(value, context) {
    if (!value) { return;}
    let json = {};
    Object.entries(schema).forEach(([key, subSchema]) => {
      if (value.hasOwnProperty(key)) {
        json[key] = getType(subSchema).serialize(value[key], context);
      }
    });
    return json;
  }

  deserialize(json, context) {
    if (!json) { return; }
    const m = this.factory();
    Object.entries(schema).forEach(([key, subSchema]) => {
      if (json.hasOwnProperty(key)) {
        m[key] = getType(subSchema).deserialize(json[key], context);
      }
    });
    return m;
  }
}

function getType(schema) {
  if (Array.isArray(schema)) {
    return list(getType(schema[0]))
  } else if (Serializable.isPrototypeOf(schema)) {
    return undefined(schema);
  } else if (typeof schema === 'object' && Object.keys(schema).length > 0) {
    return object(schema);
  } else if (typeof schema === 'object') {
    return raw(schema);
  } else if (schema === String) {
    return primitive(schema);
  } else if (schema === Boolean) {
    return primitive(schema);
  } else if (schema === Number) {
    return primitive(schema);
  }
}

function serialize(schema, thing, context = {}) {
  return getType(schema).serialize(thing, context);
}

function deserialize(schema, thing, context = {}) {
  return getType(schema).deserialize(thing, context);
}

var main = {
	schema: {
		Object: Serializable
	},
	deserialize,
	serialize
}

export default main;
export { serialize, deserialize };
